import React from 'react'
import { ScoreItem } from './ScoreItem'

export const ScoreTable = ({ data }) => {
    return(
        <table>
            <tr>
                <th>Id</th>
                <th>Task name</th>
                <th>Start time</th>
                <th>Stop time</th>
                <th>Duration</th>
            </tr>
            {data.map(elem => <ScoreItem itemData={elem} />)}
        </table>
    )
}
